import React from "react";
import Box from "@mui/material/Box";
import Grid from '@mui/material/Grid';

function About(){
    return (
        <section id="about">
            <Box sx={{flexGrow:1}}>
                <Grid container spacing={2}>
                    <Grid item xs={8}>
                        Hi this is Grace
                    </Grid>
                    <Grid item xs={4}>
                        A picture will go here
                    </Grid>
                </Grid>
            </Box>
        </section>
    );
}

export default About;
